import Timer from "./components/Timer";
import Scheduler from "./components/CalendarScheduler";

const App = () => {
  const userEmail = "testuser@example.com"; // Replace with dynamic auth

  return (
    <div className="p-4">
      <h1 className="text-2xl font-bold text-center">Pomodoro Planner</h1>
      <Timer />
      <Scheduler userEmail={userEmail} />
    </div>
  );
};

export default App;
